import React from "react";
import { useNavigate } from "react-router-dom";
import espressoImg from "./assets/espresso.png"; // Your image here
import refresherImg from "./assets/refresher.png"; // Your image here
import AddToCart from "./AddToCart";
export default function CoffeeShop() {
  const navigate = useNavigate();

  return (
    <div style={{ textAlign: "center" }}>
      <h1>Choose Your Coffee</h1>
      <div style={{ display: "flex", justifyContent: "center", gap: "2rem" }}>
        <button
          onClick={() => navigate("/espresso")}
          style={{
            border: "none",
            cursor: "pointer",
            background: "none",
            textAlign: "center",
          }}
        >
          <img
            src={espressoImg}
            alt="Espresso"
            style={{ width: "150px", height: "150px", borderRadius: "10px" }}
          />
          <div>Espresso</div>
        </button>

        <button
          onClick={() => navigate("/refresher")}
          style={{
            border: "none",
            cursor: "pointer",
            background: "none",
            textAlign: "center",
          }}
        >
          <img
            src={refresherImg}
            alt="Refresher"
            style={{ width: "150px", height: "150px", borderRadius: "10px" }}
